import React,{ useState } from 'react'

const Button = (props) =>{
    const [click,setClick] = useState(5)

    return(
        <button onClick={() => setClick(click + 1 + 5)}>{props.text} {click}</button>
    )
}
Button.defaultProps = {
    text: 'Кнопка'
}

export default Button
